schema:
syntax = "proto3";

message MemoryUsage{
int64 timestamp = 1;
 int64 totalMemory =2;
 int64 freeMemory =3;
 int64 usedMemory =4;
 double memoryUsagePercentage =5;
}

message CoreUsage{
 int32 core=1;
 double usage=2;
 }

 message CpuUsage{
 int64 timestamp=1;
 double average=2;
 repeated CoreUsage cores=3;
 }

message Metrics{
 MemoryUsage memoryUsage = 1;
 CpuUsage cpuUsage = 2;
 string serviceName = 3;
}
